import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

function QakDetail() {
  const { id } = useParams();
  const [qakData, setQakData] = useState(null);

  useEffect(() => {
    // Fetch the data for this qak by ID
    const fetchQakData = async () => {
      try {
        const response = await fetch(`http://localhost:3000/api/qaks/${id}`);
        const data = await response.json();
        setQakData(data);
      } catch (error) {
        console.error("Error fetching qak details:", error);
      }
    };

    fetchQakData();
  }, [id]);

  return (
    <div>
      {qakData ? (
        <div>
          <h2>{qakData.qak}</h2>
          {/* You can display other qak details here, e.g., qak author, qak date, etc. */}
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
}

export default QakDetail;
